const NavBar = () => {
  return (
    <nav className="navbar">
      <a href="/html/">HTML</a> |<a href="/css/">CSS</a> |
      <a href="/js/">JavaScript</a> |<a href="/python/">Python</a>
    </nav>
  );
};

export default NavBar;
